import {useState} from "react";

function Body() {
    const [isLoggedIn, setIsLoggedIn] = useState(false)
    return (
        <>
            {isLoggedIn ? (
                <p>Welcome To the Website !</p>
            ) : (
                <p>Please Login !</p>
            )}
        </>
    );
}

export default Body;
